# Fred the Fantastic
# https://stackoverflow.com/a/20380514
def get_image_size(data):
    head = data[:24]
    if imghdr.what(None, h=data) == 'png':
        check = struct.unpack('>i', head[4:8])[0]
        if check != 0x0d0a1a0a:
            return
        width, height = struct.unpack('>ii', head[16:24])
    elif imghdr.what(None, h=data) == 'gif':
        width, height = struct.unpack('<HH', head[6:10])
    elif imghdr.what(None, h=data) == 'jpeg':
        try:
            ptr = 0
            size = 2
            ftype = 0
            while not 0xc0 <= ftype <= 0xcf:
                ptr += size
                byte = data[ptr]
                ptr += 1
                while byte == 255:
                    byte = data[ptr]
                    ptr += 1
                ftype = byte
                size = struct.unpack('>H', data[ptr:ptr+2])[0] - 2
                ptr += 2
            # We are at a SOFn block
            ptr += 1  # Skip `precision' byte.
            height, width = struct.unpack('>HH', data[ptr:ptr+4])

        except Exception as e:
            # IGNORE:W0703
            raise e
    else:
        raise NotImplementedError('Can only find size of gif, jpeg, and png.')
    return width, height


